// SPDX-License-Identifier: MIT
pragma solidity >=0.4.21 <0.9.0;

import "./stoken.sol";
contract voter {
    address admin;
    address t;
   
    constructor(address sender) {
        admin =msg.sender;
        t =sender;
        stoken token1= stoken(0xFD3D5e1999e66a810e4039619924eD02f9927Aa6);
        token1.approve(sender,10);
        
    }


    function transferfrom(address token, address sender, uint value) public returns(uint){
        
        stoken token1= stoken(token);
    
        bool x=token1.transferFrom(admin, sender,value);
        if(x==true){
            return 1;

        }
        return 0;



    }

    function approve(address token , address sender, uint value) public returns(bool){
        stoken token1= stoken(token);
        return token1.approve(sender, value);
        
    }

    function ballanceof(address token , address owner) public returns(uint) {
        stoken token1=stoken(token);
        return token1.balanceOf(t);
    }

    function increase_allowence(address token , address sender, uint value)public returns(bool){
        stoken token1=stoken(token);
        return token1.increaseAllowance(sender, value);
    }

    function allowence(address token, address spender) public returns(uint){
        stoken token1=stoken(token);
        return token1.allowance(msg.sender, spender);
    }

    

    function get() public view returns(address){
        
        return (admin);
    }
}
